  name: CompiledQuery
  nameWithType: CompiledQuery
  fullName: System.Data.Objects.CompiledQuery
  type: Class
  assemblies:
  - System.Data.Entity
  namespace: System.Data.Objects
  summary: Represents a cached LINQ to Entities query.
  remarks: Provides for compilation and caching of queries for reuse. Conceptually this class contains a single `Compile` method with several overloads. You call the `Compile` method to create a new delegate to represent the compiled query. The delegate, when invoked with the <xref:System.Data.Objects.ObjectContext> input parameter and other parameter values, produces some result (such as an <xref:System.Linq.IQueryable%601> instance). The query is translated and cached when the delegate is invoked for the first time.
  example:
  - "The following example compiles and then invokes a query that accepts <xref:System.DateTime> and <xref:System.Decimal> input parameters and returns a sequence of orders where the order date is later than March 8, 2003 and the total due is less than $300.00:  \n  \n [!code-csharp[DP L2E Conceptual Examples#CompiledQuery5](~/samples/snippets/csharp/VS_Snippets_Data/DP L2E Conceptual Examples/CS/Program.cs#compiledquery5)]\n [!code-vb[DP L2E Conceptual Examples#CompiledQuery5](~/samples/snippets/visualbasic/VS_Snippets_Data/DP L2E Conceptual Examples/VB/Module1.vb#compiledquery5)]"
